  joke51: "மார்ட்டின் லூதர் கிங் நாள், நான் என் ஐந்தாவது கிரகங்களையும் கேட்டேன் அவர்கள் உலகத்தை சிறந்த இடத்தை எப்படி செய்ய வேண்டும் என்று. ஒன ் று கூறினார ், \"நான ் அப ் பொழுதும ் ஒரு முக ் கத ் திற ் கு ஒரு முக ் கத ் தை விட ் டேன ்.",
