  joke1: "आकारबाट निस्केका मानिसहरूका लागि व्यायाम: प्रत्येक हातमा पाँच पाउण्ड आलु ब्याग लिएर बेगिन. आफ्नो हात बाट सिधै बाहिर निकाल्छ, एक पूरा मिनेटका लागि त्यहाँ राख्नुहोला, र त्यसपछि आराम गर्नुहोस्. केही हप्ता पछि दश पाउण्ड आलु ब्यागमा सार्नुहोस्. त्यसपछि ५० पाउण्ड आलु ब्याग प्रयास गर्नुहोस्, र अन्त्यमा तपाईँले प्रत्येक हातमा १०० पाउण्ड आलु ब्याग लिफ्ट गर्न सक्नुहुन्छ र पूर्ण मिनेटभन्दा बढी आफ्नो हात समात्ने प्रयास गर्नुहोस्. एक पटक त्यो स्तरमा दिक्क लाग्छ, प्रत्येक झोलामा आलु लगाएँ.",
  joke2: "मेरो छोरीले सेमेस्टर सुरु हुनुपूर्व सम्भावित विद्यार्थीबाट यो ई-मेल प्राप्त गरिन्: प्रिय प्रोफेसर, म कुनै पनि कक्षामा आउन वा कुनै परीक्षाका लागि भेट्न सकिनँ. यो समस्या के हो?",
  joke3: "दुई जना मानिस जंगलमार्फत हिँडिरहेका छन् जब एक जना बाहिर निस्कन्छ, \" सर्प! दौंतरी! \" उसका साथी हाँस्छन् उसमा. \" ओह, आराम. यसको एक मात्र बच्चा, उनी भन्छन्. \" राँगाको कुरा सुन्नु हुन्न?",
